    LOG.trace("Entering wait");
    latch.await();
    LOG.trace("Wait completed");

    if (isCancelled()) throw new CancellationException();

    Object object = result.get();
    if (object instanceof ExecutionException) {
        throw (ExecutionException) object;
    } else {
        return (V) object;
    }
}

